import React from "react";

const DynamicTable = ({sqlData}) => {

    const column = []

    for(let i in sqlData){
        for(let j in i){
            column.push(j)
        }
        break
    }

    console.log(column)

    return (
        <table>
            <thead>
                <tr>
                    {column.map((item, index) => <ColumnName item = {item}/>)}
                </tr>
            </thead>
            <tbody>
                <tr>

                </tr>
            </tbody>
        </table>
    )

}

const ColumnName = ({item}) => <th>{item}</th>

export default DynamicTable;
